<!DOCTYPE html>
<html>
    <head>
        <title>Teste de Personalidade MBTI</title>
        <meta charset="utf-8" />
        <style>
            .question {
                margin-bottom: 10px;
            }

            .question label {
                display: block;
                font-weight: bold;
            }

            .question input[type="range"] {
                width: 300px;
                -webkit-appearance: none;
                background-color: #f1f1f1;
                height: 10px;
                border-radius: 5px;
                outline: none;
                margin: 0;
                padding: 0;
                margin-top: 1em;
            }

            .question input[type="range"]::-webkit-slider-thumb {
                -webkit-appearance: none;
                width: 20px;
                height: 20px;
                background-color: white;
                border: 1px solid #999;
                border-radius: 50%;
                cursor: pointer;
                transition: border-color 0.2s ease-in-out;
                zoom: 1;
            }
            .question input[type="range"]::-webkit-slider-thumb:hover {
                border-color: #392de3;
                zoom: 1.5;
            }

            /* Adicionado CSS customizado */
            .question input[type="range"]::-webkit-slider-runnable-track {
                background: linear-gradient(to right,  #b6cf27 10%, #ffffff 50%, #e02121 90%);
                background-size: 200% 100%;
                background-position: center;
                border-radius: 5em;
            }
            .question
                input[type="range"].a-total-agree::-webkit-slider-runnable-track {
                background-position: 0%;
            }
            .question
                input[type="range"].a-partial-agree::-webkit-slider-runnable-track {
                background-position: 27.5%;
            }
            .question
                input[type="range"].a-neutral::-webkit-slider-runnable-track {
                background-position: 50%;
            }
            .question
                input[type="range"].a-partial-disagree::-webkit-slider-runnable-track {
                background-position: 72.5%;
            }
            .question
                input[type="range"].a-total-disagree::-webkit-slider-runnable-track {
                background-position: 100%;
            }

            .question input[type="range"]:focus::-webkit-slider-runnable-track {
                outline: none;
            }
            .result {
                margin-top: 20px;
            }
            .result .bar {
                display: inline-block;
                height: 20px;
                background-color: #392de3;
            }
            #result-img {
                margin-top: 20px;
                border: 1px solid #999;
                height: 50vmin;
            }
        </style>
        <style>
            /* Estilos gerais */
            body {
                font-family: Arial, sans-serif;
                margin: 0;
                padding: 20px;
            }

            .container {
                display: grid;
                grid-template-columns: repeat(12, 1fr);
                grid-gap: 20px;
            }
            #quiz-form {
                grid-column: 1 / span 12;
            }
            .message-info {
                background: #0000001c;
                border-radius: 1em;
                padding: 1em 2em;
                margin-bottom: 2em;
            }

            /* Estilos para telas maiores (desktop) */
            @media (min-width: 768px) {
                .container {
                    max-width: 960px;
                    margin: 0 auto;
                }

                h1, h2, h3, h4, h5, h6 {
                    grid-column: 1 / span 12;
                }
                p {
                    grid-column: 1 / span 12;
                }

                .question {
                    grid-column: 1 / span 12;
                    margin-bottom: 20px;
                }

                .result {
                    grid-column: 1 / span 12;
                    margin-top: 40px;
                    text-align: center;
                }

                #result-img {
                    margin-top: 20px;
                    border: 1px solid #999;
                    height: 400px;
                    width: 100%;
                    max-width: 600px;
                    margin: 0 auto;
                }

                .result button {
                    margin-top: 20px;
                }
            }

            /* Estilos para telas menores (mobile) */
            @media (max-width: 767px) {
                .container {
                    grid-template-columns: 1fr;
                }

                h1 {
                    text-align: center;
                    margin-bottom: 20px;
                }

                .question {
                    margin-bottom: 20px;
                }

                .result {
                    margin-top: 40px;
                    text-align: center;
                }

                #result-img {
                    margin-top: 20px;
                    border: 1px solid #999;
                    height: auto;
                    width: 100%;
                    max-width: 300px;
                    margin: 0 auto;
                }

                .result button {
                    margin-top: 20px;
                }
            }
        </style>
    </head>
    <body>
        <div class="container">
            <h1>Teste de Personalidade MBTI</h1>
            <form id="quiz-form">
                <div id="questions-container"></div>
            </form>
        </div>
